script = [
    {
        name: "text&timeline",
        startBeat: 0,
        endBeat: 1612,
        script: function (varibles) {
            background(250, 248, 219);

            noStroke();
            textSize(Abs(0.07));
            fill(93, 25, 7);
            textAlign(RIGHT, TOP);
            textFont('Kosugi Maru');
            text(`混乱少女❤️そふらんちゃん!!`, RelX(0.98), RelY(-0.95));
            textSize(Abs(0.03));
            textAlign(RIGHT, TOP);
            text(`(ノリニクシティ・アンリミテッド☆プログレッシヴ・ポリリズミック・ナイトメア・ロングバージョン)`, RelX(0.98), RelY(-0.789));

            strokeWeight(Abs(0.003));
            stroke(93, 25, 7);
            let length = varibles.var["tsUp"] / varibles.var["tsDown"]
            let height = 0.68
            line(RelX(-length / 2), RelY(height), RelX(length / 2), RelY(height));
            for (let i = 0; i <= varibles.var["tsUp"]; i++)
                line(RelX(length * i / varibles.var["tsUp"] - length / 2), RelY(height - 0.02), RelX(length * i / varibles.var["tsUp"] - length / 2), RelY(height + 0.02));
            fill(120, 193, 185);
            circle(varibles["var"].pos.x, varibles["var"].pos.y, varibles["var"].size);

            textFont('Comfortaa');
            fill(93, 25, 7);
            textSize(Abs(0.07));
            textAlign(CENTER, CENTER);
            text(`BPM: ${varibles.var["bpm"]}      TS: ${varibles.var["tsUp"]}/${varibles.var["tsDown"]}`, RelX(0), RelY(0.835));
        },
        varibles: {
            var: [{
                startBeat: 0,
                endBeat: 1612,
                script: function (progress, nowBeat) {
                    let nowBpm = 0;
                    for (let i = 0; i < bpm.length; i++) if (nowBeat >= bpm[i].beat) { nowBpm = bpm[i].bpm; }
                    let nowTs = {};
                    for (let i = 0; i < ts.length; i++) if (nowBeat >= ts[i].beat) { nowTs = ts[i] }
                    let length = nowTs.up / nowTs.down
                    return {
                        pos: Rel(((nowBeat - nowTs.beat) / 4 % (nowTs.up / nowTs.down)) - length / 2, 0.68),
                        size: (1 - Easings.OutSine((nowBeat - nowTs.beat) % (4 / nowTs.down) / (4 / nowTs.down))) * Abs(0.005) + Abs(0.03),
                        bpm: nowBpm,
                        tsUp: nowTs.up,
                        tsDown: nowTs.down
                    };
                }
            }]
        }
    },
    {
        name: "plot",
        startBeat: 0,
        endBeat: 1612,
        script: function (varibles) {
            let now = getDistance(varibles.nowBeat);
            textStyle(BOLD);
            timings.forEach((val, idx) => {
                if (val.distance < now ? (now - val.distance) / windowWidth <= 0.5 : (val.distance - now) / windowWidth <= 2) {
                    let myDis = (val.distance - now) / windowWidth;
                    if (val.up == 0) {
                        if (idx == 0 ? true : (timings[idx - 1].tsUp != val.tsUp || timings[idx - 1].down != val.down)) {
                            noStroke();
                            textSize(Abs(0.02));
                            textAlign(CENTER, CENTER);
                            fill(239, 97, 77);
                            text(`${val.tsUp}/${val.down}`, RelX(-0.7 + myDis), RelY(0.626));
                        }

                        strokeWeight(Abs(0.004));
                        stroke(239, 97, 77);
                    }
                    else {
                        strokeWeight(Abs(0.002));
                        stroke(247, 146, 98);
                    }
                    line(RelX(-0.7 + myDis), RelY(0.6), RelX(-0.7 + myDis), RelY(0.6 - (val.bpm / 500) * 1.6));
                    if (idx == 0 ? true : timings[idx - 1].bpm != val.bpm) {
                        noStroke();
                        fill(93, 25, 7);
                        textSize(Abs(0.02));
                        textAlign(LEFT, CENTER);
                        text(`${val.bpm}`, RelX(-0.7 + myDis + 0.005), RelY(0.6 - (val.bpm / 500) * 1.6 - 0.025));

                        strokeWeight(Abs(0.004));
                        stroke(104, 159, 156);
                        line(RelX(-0.7 + myDis), RelY(0.6 - ((idx == 0 ? val.bpm : timings[idx - 1].bpm) / 500) * 1.6), RelX(-0.7 + myDis), RelY(0.6 - (val.bpm / 500) * 1.6));
                    }
                    if (idx != timings.length - 1) {
                        strokeWeight(Abs(0.004));
                        stroke(104, 159, 156);
                        line(RelX(-0.7 + myDis), RelY(0.6 - (val.bpm / 500) * 1.6), RelX(-0.7 + (timings[idx + 1].distance - now) / windowWidth), RelY(0.6 - (val.bpm / 500) * 1.6));
                    }
                }
            });

            strokeWeight(Abs(0.004));
            stroke(93, 25, 7);
            line(RelX(-0.7), RelY(-1), RelX(-0.7), RelY(0.6));
            line(RelX(-1), RelY(0.6), RelX(1), RelY(0.6));

            for (let i = 1; i <= 9; i++) {
                strokeWeight(Abs(0.002));
                stroke(93, 25, 7);
                line(RelX(-0.7), RelY(0.6 - (i * 50 / 500) * 1.6), RelX(-0.68), RelY(0.6 - (i * 50 / 500) * 1.6));

                noStroke();
                fill(93, 25, 7);
                textSize(Abs(0.02));
                textAlign(RIGHT, CENTER);
                text(`${i * 50}`, RelX(-0.71), RelY(0.6 - (i * 50 / 500) * 1.6));
            }
        },
        varibles: {
            nowBeat: [
                {
                    startBeat: 0,
                    endBeat: 1612,
                    script: function (progress, nowBeat) {
                        return nowBeat;
                    }
                }
            ]
        }
    }
];



